scriptlet.script:
try{
	variableNamesList = variableNames.split(delimiter);	
	for (var i = 0; i < variableNamesList.length; i++) {		 
		scriptletContext.put(
			variableNamesList[i],
			scriptletContext.get(variableNamesList[i]).trim()
		)
	}	
	response = "success";
} catch(err) {
	errorMessage = 'An error occured while parsing the DB records : ' + err.message;
	scriptletContext.put("errorMessage", errorMessage);
	scriptletContext.put("failureFlag", "True");	
	response = "failure";
}
scriptletResponse = response

